import React from 'react';
import { Provider } from 'react-redux';
import { store } from './store';
import StopsContainer from './components/stops/Stops';

function App() {
	return (
		<Provider store={store}>
			<StopsContainer />
			<h1>Hello word</h1>
		</Provider>
	);
}

export default App;
